import React from 'react';
import './ManualMonitoring.css'; // Optional: Add CSS for styling
import pic1 from './pic1.png'; // Import the image

function ManualMonitoring() {
  return (
    <div className="manual-monitoring">
      <div className="content">
        <div className="text">
          <h2>Manual monitoring of AC systems is costing you time, energy, and money</h2>
          <p>
            Traditional AC monitoring methods are inefficient and prone to human error, leading to increased costs and energy waste.
          </p>
        </div>
        <img src={pic1} alt="Manual Monitoring" className="image" />
      </div>
    </div>
  );
}

export default ManualMonitoring;
